import React from "react";
import ReactDOM from "react-dom";
import SubmitButton from './SubmitButton';
import SearchBar from './SearchBar';

var destination = document.querySelector("#container")

ReactDOM.render(
    <div className="Increment">
        <form>
            <SearchBar />
            <SubmitButton />
        </form>
    </div>,
    destination
);
